import React from 'react'
import ListEquipment from "../components/List_equipment";


export default function PageRevision() {
    return (
        <>
        <NavLink to="revision" className="nav-link link-primary" >Перегляд</NavLink>
        <NavLink to="additions" className="nav-link link-primary">Додати нову техніку</NavLink>
        <NavLink to="transfer" className="nav-link link-primary">Виписати наряд</NavLink>
        <ListEquipment/>
        </>
    )
}
